import React, { useEffect, useState } from 'react';
import axiosInstance from '../utils/axiosInstance';
import '../css/Running/RunningPage.css'; // 스타일 파일을 임포트
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import '../css/WeekDaysSlider.css';
import Modal from 'react-modal';

const RunningList = () => {
  const [runnings, setRunnings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedDate, setSelectedDate] = useState(new Date().toISOString().slice(0, 10)); // 초기 날짜 설정
  const [modalIsOpen, setModalIsOpen] = useState(false);  // 모달 변수 설정
  const [modalType, setModalType] = useState('');
  const [selectedStartLocation, setSelectedStartLocation] = useState('');

  const currentDate = new Date();
  const week = ['일', '월', '화', '수', '목', '금', '토'];
  const daysToShow = 14; // 14일 동안 보여줍니다

  const days = [];
  for (let i = 0; i < daysToShow; i++) {
    const date = new Date();
    date.setDate(currentDate.getDate() + i);

    const formattedViewDate = `${date.getDate()}`;
    const formattedDate = `${date.getFullYear()}-${('0' + (date.getMonth() + 1)).slice(-2)}-${('0' + date.getDate()).slice(-2)}`;
    const dayOfWeek = week[date.getDay()];

    days.push(
      <div key={i} className="dateWrap isSun clickable-text" onClick={() => handleDateClick(formattedDate)}>
        <p>{formattedViewDate}</p>
        <span>{dayOfWeek}</span>
      </div>
    );
  }

  const openModal = (type) => {
    setModalIsOpen(true);
    setModalType(type);
  };

  const closeModal = () => {
    setModalIsOpen(false);
    setModalType('');
  };

  const handleFilterComplete = (data) => {

    // 필터 완료 시 로직
  }

  const handleDateClick = (date) => {
    setSelectedDate(date);
  }

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 7,
    slidesToScroll: 7,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 5,
          slidesToScroll: 1,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 1,
          initialSlide: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
        },
      },
    ],
  };

  useEffect(() => {
    console.log(selectedDate);
    const fetchRunnings = async () => {
      try {
        const response = await axiosInstance.get('/api/runnings/get', {
          params: {
            date: selectedDate, // 선택된 날짜로 API 호출
          },
        });
        setRunnings(response.data.data);
      } catch (error) {
        console.error('Error fetching boards:', error);
        setError('게시판 목록을 가져오는 중 오류가 발생했습니다.');
      } finally {
        setLoading(false);
      }
    };

    fetchRunnings();
  }, [selectedDate]);

  const renderModalContent = () => {
    switch(modalType) {
      case 'startLocation':
        return (
          <div>
            <h2>시작 지역 선택</h2>
            <ul className='filter--list'>
              <li className='filter--list--item'>
                <a>모든지역</a>
              </li>
              <li className='filter--list--item'>
                <a onClick={() => setSelectedStartLocation('서울')}>서울</a>
              </li>
            </ul>
            <button onClick={() => handleFilterComplete()}>완료</button>
          </div>
        );
      case 'finishLocation':
        return (
          <div>
            <h2>도착 지역 선택</h2>
            <select>
              <option value="서울">서울</option>
              <option value="부산">부산</option>
              {/* 추가 옵션들 */}
            </select>
            <button onClick={() => handleFilterComplete()}>완료</button>
          </div>
        );
      case 'gender':
        return (
          <div>
            <h2>성별 선택</h2>
            <select>
              <option value="남성">남성</option>
              <option value="여성">여성</option>
            </select>
            <button onClick={() => handleFilterComplete()}>완료</button>
          </div>
        );
      case 'distance':
        return (
          <div>
            <h2>거리 선택</h2>
            <select>
              <option value="5km">5km</option>
              <option value="10km">10km</option>
              {/* 추가 옵션들 */}
            </select>
            <button onClick={() => handleFilterComplete()}>완료</button>
          </div>
        );
      default:
        return null;
    }
  };

  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>{error}</p>;
  }

  return (
    <div>
      <Slider {...settings}>
        {days}
      </Slider>
      <div className='main__filter'>
        <div className='filter--wrapper'>
          <ul>
            <li className='clickable-text' onClick={() => openModal('startLocation')}>
              <span>시작지역</span>
            </li>
            <li className='clickable-text' onClick={() => openModal('finishLocation')}>
              <span>도착지역</span>
            </li>
            <li className='clickable-text' onClick={() => openModal('')}>
              <span>마감 가리기</span>
            </li>
            <li className='clickable-text' onClick={() => openModal('gender')}>
              <span>성별</span>
            </li>
            <li className='clickable-text' onClick={() => openModal('distance')}>
              <span>거리별</span>
            </li>
          </ul>
        </div>
      </div>

      <div>
        {runnings.length === 0 ? (
          <div className='no-data-message'><p>런닝이 없습니다.</p></div>
        ):(
          <ul className="running-list">
            {runnings.map((running) => (
              <li key={running.id} className="running-item">
                <div className="running-item__time">
                  <p>{running.time}</p>
                </div>
                <div className="running-item__info">
                  <h3>{running.title}</h3>
                  <p>{running.content}</p>
                  <div className="item-details">
                    <p>제한 인원: {running.limitedPeople}명</p>
                    <p>시작 위치: {running.startLocation}</p>
                    <p>도착 위치: {running.finishLocation}</p>
                    <p>거리: {running.distance}km</p>
                  </div>
                </div>
              </li>
            ))}
          </ul>
        )}
        <Modal
          isOpen={modalIsOpen}
          onRequestClose={closeModal}
        >
          {renderModalContent()}
          <button onClick={closeModal}>닫기</button>
        </Modal>
      </div>
    </div>
  );
};

export default RunningList;
